  pad = pad ? (max - min) * .03 : 0;\n            range.start = min - pad;\n            range.end = max + pad;\n        } else console.error('backtesting: scale range error:', min, max, range);\n    };\n}\n\nclearTimeout(window._bt_autoscale_timeout);\n\nwindow._bt_autoscale_timeout = setTimeout(function () {\n    /**\n     * @variable cb_obj `fig_ohlc.x_range`.\n     * @variable source `ColumnDataSource`\n     * @variable ohlc_range `fig_ohlc.y_range`.\n     * @variable volume_range `fig_volume.y_range`.\n     */\n    \"use strict\";\n\n    let i = Math.max(Math.floor(cb_obj.start), 0),\n        j = Math.min(Math.ceil(cb_obj.end), source.data['ohlc_high'].length);\n\n    let max = Math.max.apply(null, source.data['ohlc_high'].slice(i, j)),\n        min = Math.min.apply(null, source.data['ohlc_low'].slice(i, j));\n    _bt_scale_range(ohlc_range, min, max, true);\n\n    if (volume_range) {\n        max = Math.max.apply(null, source.data['Volume'].slice(i, j));\n        _bt_scale_range(volume_range, 0, max * 1.03, false);\n    }\n\n}, 50);\n"},"id":"2754856","type":"CustomJS"},{"attributes":{"fill_alpha":{"value":0.2},"fill_color":{"value":"cyan"},"hatch_alpha":{"value":0.2},"hatch_color":{"value":"cyan"},"line_alpha":{"value":0.2},"line_color":{"value":"cyan"},"size":{"value":8},"x":{"value":197},"y":{"value":1.0471546979999986}},"id":"2754597","type":"Scatter"},{"attributes":{"coordinates":null,"formatter":{"id":"2754543"},"group":null,"major_label_policy":{"id":"2754823"},"ticker":{"id":"2754514"},"visible":false},"id":"2754513","type":"LinearAxis"},{"attributes":{},"id":"2754509","type":"LinearScale"},{"attributes":{"axis":{"id":"2754754"},"coordinates":null,"dimension":1,"group":null,"ticker":null},"id":"2754757","type":"Grid"},{"attributes":{},"id":"2754606","type":"AllLabels"},{"attributes":{"below":[{"id":"2754699"}],"center":[{"id":"2754702"},{"id":"2754706"},{"id":"2754723"}],"height":90,"left":[{"id":"2754703"}],"min_border_bottom":6,"min_border_left":0,"mi
